import React from "react";
import Nav from "./Nav";
import CollectionSetup from "./CollectionSetup";

const Container = () => {
  return (
    <section className="uk-grid uk-grid-stack uk-child-width-expand@m uk-grid-small">
      <div
        className="uk-width-1-3@m"
        uk-height-viewport="offset-top: true;offset-bottom: true">
        <Nav />
      </div>
      <div style={{ paddingLeft: "2px" }}>
        <CollectionSetup />
      </div>
    </section>
  );
};

export default Container;
